import React from "react";
import StarIcon from "@material-ui/icons/Star";
import IMDB from "../../image/imdb.png";
import url from "../../image/movie1.jpg";
import "./ContentItem.css";
const ContetntItem = () => {
  const href = "/";
  return (
    <div className="item">
      <a href={href}>
        <img src={url} className="item-img" alt="عکس فیلم" />
        <div>
          <p className="item-header">دورافتاده</p>
          <div className="item-text">
            <span className="item-icon">
              <StarIcon />
            </span>
            <span className="item-rate">3.5</span>
            <div className="item-imdb">
              <span className="item-idmb-text">3</span>
              <img src={IMDB} alt="IMDB" className="item-imdn"/>
            </div>
          </div>
        </div>
      </a>
    </div>
  );
};
export default ContetntItem;
